import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Footer from '../Footer';
import TodoList from './TodoList';

function Home() {
  return (
    <>
      <HeroSection />
      <Cards />
      <TodoList />
      <input type = "text"/>
      
      <Footer />
    </>
  );
}

export default Home;
